import React, { Component } from 'react'
import ViewerNetworkVisualization from "./components/Viewer_network_visualization/ViewerNetworkVisualization.jsx"
import ViewerPotenMatch from "./components/viewer_potenMatch/ViewerPotenMatch.jsx"

class SearchMatch extends Component {

    likeClicked = () =>{
        console.log(this.state.currentId);
        this.setState(prevstate => (
            { currentId: prevstate.currentId + 1}
            ))
    }

    backClicked = () =>{
        console.log(this.state.currentId);
        this.setState(prevstate => (
            { currentId: prevstate.currentId - 1}
            ))
    }

    unlikeClicked = () =>{
        console.log(this.state.currentId);
        this.setState(prevstate => (
            { currentId: prevstate.currentId + 1}
            ))
    }

    render() {
        return (
            <div>

               <ViewerNetworkVisualization/> 
               <ViewerPotenMatch likeClicked={this.likeClicked} backClicked={this.backClicked}   /> 
        
            </div>
        )
    }
}

export default SearchMatch
